**	FLX/JPC/CRC/JJM/CCM/HJM/JHM/HCM/CHM/JCM/CJM						
	FLX	normal flexible surfaced pavement (FRDW: less than 1 meter is different pavement type)					
	JPC	normal JPCP (FRDW: less than 1 meter is different pavement type or column)					
	CRC	normal CRCP (FRDW: less than 1 meter is different pavement type or strip)					
	JJM	Mixed Lane; both wheelpaths are JCP but on different columns					
	CCM	Mixed Lane; both wheelpaths are CRCP but on different strips					
	HJM	Mixed Lane; Left Wheelpath is flexible and right wheelpath is JCP					
	JHM	Mixed Lane; left wheelpath is JCP and right wheelpath is flexible					
	HCM	Mixed Lane; Left Wheelpath is flexible and right wheelpath is CRCP					
	CHM	Mixed Lane; left wheelpath is CRCP and right wheelpath is flexible					
	JCM	Mixed Lane; left wheelpath is JCP and right wheelpath is CRCP					
	CJM	Mixed Lane; left wheelpath is CRCP and right wheelpath is JCP					
